import React from 'react';
import Navbar from '../components/Navbar';
import SearchRide from '../components/SearchRide';
import StartRide from '../components/StartRide';
import './HomePage.css';

const HomePage = () => {
  return (
    <div>
      <Navbar />
      <div className="homepage">
        <SearchRide />
        <StartRide />
      </div>
    </div>
  );
};

export default HomePage;
